import React from 'react'

const Users = () => {

    return (
        <div>
            Users here
        </div>
    )
}

const mapDispatchToProps = {
  showNotification,
  addBlog
}

const mapStateToProps = (state) => {
  return {
    users: state.users
  }
}

const ConnectedUsers = connect(
  mapStateToProps,
  mapDispatchToProps
)(Users)
export default ConnectedUsers
